import { View, Text} from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
const SignIn = () => {
  return (
    <SafeAreaView>
      <Text>Halaman SignIn </Text>
    </SafeAreaView>
  )
}

export default SignIn;
